oxy_webhelp_navlinks = {"main_interface_introduction-d570e150":{"topics":[{"title":"导航窗口","shortdesc":"<p class=\"shortdesc\">导航窗格是Zotero用户界面的一个重要组成部分，位于软件窗口的左侧。它为用户提供了一个方便的途径来浏览和组织他们的文献资料。<\/p>","href":"3zotero界面概述\/zotero_navigation_pane.html","attributes":{"data-id":"zotero_navigation_pane_0"},"menu":{"hasChildren":false},"tocID":"zotero_navigation_pane_0-d570e161","topics":[]},{"title":"文献库","shortdesc":"<p class=\"shortdesc\">文献库是Zotero中用户管理和存储所有文献资料的核心区域。这里汇集了用户收集的所有文献条目，包括书籍、期刊文章、会议论文等。<\/p>","href":"3zotero界面概述\/zotero_library.html","attributes":{"data-id":"zotero_library"},"menu":{"hasChildren":false},"tocID":"zotero_library-d570e172","topics":[]},{"title":"右侧面板（文献详情）","shortdesc":"<p class=\"shortdesc\">右侧面板是Zotero界面中显示文献详细信息的区域。当用户在文献库中选择一个文献条目时，右侧面板会展示该文献的详细资料和附加信息。<\/p>","href":"3zotero界面概述\/right_panel.html","attributes":{"data-id":"right_panel"},"menu":{"hasChildren":false},"tocID":"right_panel-d570e183","topics":[]}]}};